Register variables are variables that the programmer suggests should be stored in one of the machine's registers, rather than in random-access memory (RAM). The register keyword is used to declare a register variable. The compiler may ignore this suggestion if it decides that the variable is used too infrequently to justify the use of a register, or if the machine does not have enough registers to accommodate all the variables that are declared as register variables.
